import React from 'react';
import red from './back.jpg';
import './Header.css';
<link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.15.3/css/all.css" integrity="sha384-DfzL+gJZzkzLvM6+5uBz63bB+lVE2WRfX8W57FzvZ5TC5Sz2mAW+aGvDyIaA/N5a" crossorigin="anonymous"></link>

const Header = () => {
  return (
    <header className="header">
      <div className="header-logo">
        <img src={red} alt="Conciertos Logo" />
      </div>
      <nav className="header-nav">
        <ul className="header-nav-list">
          <li><a href="#">Inicio</a></li>
          <li><a href="#">Conciertos</a></li>
          <li><a href="#">Artistas</a></li>
          <li><a href="#">Boletos</a></li>
        </ul>
        <div className="header-socials">
          <a href="https://www.facebook.com"><i className="fab fa-facebook"></i></a>
          <a href="https://www.instagram.com"><i className="fab fa-instagram"></i></a>
          <a href="https://www.twitter.com"><i className="fab fa-twitter"></i></a>
        </div>
      </nav>
    </header>
  );
};

export default Header;
